(26, 131, 'акнгбву6вюд юипж', 9, 0, 0, '2017-04-23 19:10:04'),
(27, 123, 'jbkОмелян сподівається на підписання Ryanair договорів з аеропортами вже в травні.\r\n\r\nМіністр інфраструктури Володимир Омелян вважає, що ініціатива про залучення ірландського лоукостера Ryanair до аеропорту "Антонов" під Гостомелем замість міжнародного аеропорту "Бориспіль" є неправильною.\r\n\r\nПро це Омелян сказав в інтерв''ю LIGA.net.\r\n\r\n"Я вважаю, що якщо ми це допустимо, це буде великою помилкою. У перспективі, якщо Бориспіль стане реальним, а не потенційним хабовим аеропортом, Ryanair дійсно може піти в той же Житомир, Гостомель чи ще кудись. Але на нинішньому етапі це неправильно. У нас літає всього 4% населення. Пасажиропотік Борисполя - 8-8,5 млн осіб на рік. Це дуже мало", - наголосив міністр.\r\n\r\nОмелян зауважив, що всі аеропорти, в які заходив Ryanair, згодом нарощували пасажиропотік в рази.\r\n\r\n"Те ж саме буде і в Україні", - наголосив він.\r\n\r\nЗа словами очільника міністерства, наразі Харків готовий приймати у себе Ryanair навіть з більш низькою фінансовою пропозицією, але Ryanair поки літати туди не планує. \r\n\r\nОмелян повідомив, що робота із залучення Ryanair до України тривала понад п''ять років, а активні переговори відбувалися останні вісім місяців. \r\n\r\n"В кінці квітня представники Міністерства інфраструктури та аеропортів "Львів" і "Бориспіль" в рамках Міжнародного форуму Routes Europe, який пройде в Белфасті, проведуть зустріч з представниками Ryanair і інших авіакомпаній. Сподіваюся, всі технічні деталі будуть узгоджені, і ми зможемо підписати договори в травні", - зазначив посадовець. Більше читайте тут: https://tsn.ua/ukrayina/u-mininfrastrukturi-prokomentuvali-iniciativu-borispolya-vidpraviti-ryanair-do-gostomelya-917603.htmlv', 9, 0, 0, '2017-04-23 19:21:16'),
