INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(102, 'Стихийное бедствие в ботаническом саду Днепра: непогода уничтожила сотни редких растений', 'Стихийное бедствие, которое накрыло Днепр 18-19 апреля, больно ударило по растениям в единственном в городе ботаническом саду. \r\n\r\nОб этом Информатору рассказал и.о. директора ботанического сада ДНУ Анатолий Кабар.\r\n\r\n\r\n\r\n«19 числа я зашел на территорию ботсада, а тут кошмар. Первый фактор — это мокрый снег, он прилип в кронах, особенно хвойных деревьев. Второй фактор — это то, что деревья перевели большую часть своего крахмала в сахар. Соответственно, хрупкость древесины возросла в несколько раз», — рассказал он.', 'data:image/tmp;base64,', '2017-04-23 18:23:19', 27);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(103, 'Стали известны 100 самых влиятельных людей 2017 года', 'Журнал Time назвал 100 самых влиятельных людей 2017 года.\r\n\r\nОб этом сообщает Информатор со ссылкой на The Times.\r\n\r\nЖурнал разместил избранную сотню под категорией «Лидеры».\r\n\r\nВ этот список попал, президент Соединенных Штатов Дональд Трамп, который отдал приказ выпустить более 50 крылатых ракет «Томагавк» по авиабазе в Сирии в ответ на применение там химического оружия. Также Трамп подписал указ, затрудняющий получение рабочих виз в США, в том числе для украинских программистов.', 'data:image/tmp;base64,', '2017-04-23 18:28:10', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(104, 'Exit polls: во второй тур выборов во Франции выходят Макрон и Ле Пен', 'Стали известны данные первых экзит-полов, согласно которым больше всего французов проголосовали за бывшего министра экономики Франции Эммануэля Макрона.\r\n\r\nЕго поддерживает 24% избирателей. 22% французов видят президентом Марин Ле Пен. Далее следует Франсуа Фийон, у которого 21% и Жан-Люк Меланшон – с 18%.\r\n\r\nПоскольку, скорее всего, ни одному из кандидатов не удастся набрать более 50% голосов, поэтому победителя определят в ходе второго тура, намеченного на 7 мая. Активность избирателей находится на уровне предыдущих выборов, которые прошли пять лет назад.\r\n\r\nПервые предварительные результаты на основе подсчета бюллетеней появятся не ранее 9 часов вечера.', 'data:image/tmp;base64,', '2017-04-23 18:36:21', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(105, 'Extyyst', 'В Лондоне открыт засекреченный архив Комиссии ООН по военным преступлениям. Речь идет о десятках тысяч документов с детальным описанием системы лагерей смерти. Многие бумаги использовались при подготовке Нюрнбергского процесса. Но с началом холодной войны архив закрыли, а сотни преступников избежали наказания. Теперь эти материалы в свободном доступе, и заставляют по-новому взглянуть на роль США и Британии в реабилитации нацистов.\r\n\r\nЗасекреченный архив Комиссии ООН по расследованию военных преступлений — это 516 коробок с документами. После того, как они были отсканированы, все уместилось на небольшом диске, и теперь доступно в электронном виде посетителям находящейся в Лондоне Библиотеки Винера. Это самый известный в мире архив, собирающий данные о Холокосте. Среди открытых сегодня документов — первое обвинение, заочно предъявленное Адольфу Гитлеру. Еще в декабре 1944 года правительство Чехии в изгнании потребовало над ним суда.\r\n\r\n«Гитлер тогда был руководителем страны — нацистской Германии. И впервые в истории действующему главе государства было предъявлено обвинение в совершении военных преступлений», — подчеркивает директор Библиотеки Винера Бен Баркоу.\r\n\r\nВ этом архиве детальное описание зверств в лагерях смерти, свидетельства бывших узников и военнопленных, протоколы допросов. Союзники по антигитлеровской коалиции собирали эти доказательства с 1943 года. На их основании было предъявлено 8 тысяч обвинений. Но только 2 тысячи дошли до суда.\r\n\r\nВ 1948 году работа комиссии вообще прекратилась. США и Великобритания не были заинтересованы в чрезмерном усердии по расследованию преступлений нацистов, потому что некоторых из них было решено использовать для строительства Западной Германии.\r\n\r\n«Я думаю, что многие акценты могут быть по-другому освещены — в частности, о сотрудничестве элит Великобритании и США с нацистской Германией», — подчеркивает директор Центра военно-политических исследований Алексей Подберезкин.\r\n\r\nПокровительство Вашингтона дало возможность многим преступникам избежать суда. Среди них — бывший бухгалтер Освенцима, эсэсовец Оскар Грёнинг, который спокойно жил, получая пенсию три тысячи евро. И только в 2016году он все-таки был осужден за преступления, совершенные больше семидесяти лет назад.\r\n\r\n«Об этом суде говорили, как о последней возможности покарать этого нацистского преступника в Германии. Но на самом деле, обвинение в отношении Грёнинга было составлено комиссией ООН много десятилетий назад», — подчеркивает директор Библиотеки Винера Бен Баркоу.\r\n\r\nПосле роспуска комиссии по расследованию военных преступлений, ее архив был засекречен. Для доступа к нему исследователям было необходимо предоставить официальное письмо от своего правительства и получить согласие генерального секретаря ООН.\r\n\r\n«И даже если вы туда попадали, то сотрудники архива не очень-то хотели вам все показывать, — рассказывает Бен Баркоу. — Говорили, что здесь запрещали что-либо копировать, даже пометки было делать нельзя».\r\n\r\nХолодная война многое превратила в разменную монету. На волне антикоммунизма в США под давлением сенатора Джозефа Маккарти досрочно освобождали даже тех, кого осудил международный Нюрнбергский трибунал.\r\n\r\nТот факт, что архив с документами о преступлениях нацистов на протяжении десятилетий был засекречен, говорит о циничном отношении к урокам Второй мировой войны.\r\n\r\nИ то, что теперь эти свидетельства, наконец, открыты — пусть запоздалый, но все равно, верный шаг.', 'data:image/tmp;base64,', '2017-04-23 18:39:00', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(106, '"РЕАЛ" - "БАРСЕЛОНА": ГДЕ СМОТРЕТЬ ОНЛАЙН ЭЛЬ-КЛАССИКО 23.04.2017, ТРАНСЛЯЦИЯ, ПРОГНОЗ ', 'Подробности предстоящего эль-классико "Реал" Мадрид - "Барселона" 23 апреля 2017, прогноз на игру, ставки букмекеров - читайте в обзоре TopNews.\r\n23 апреля 2017 года на стадионе "Сантьяго Бернабеу" состоится грандиозное сражение монстров современного футбола - эль-класико "Реал Мадрид" - "Барселона". Начало игры в 21:45 мск.\r\n"Реал" Мадрид - "Барселона" 23 апреля 2017: смотреть онлайн, по какому каналу трансляция?\r\nВ прямом эфире трансляцию матча "Реал Мадрид" - "Барселона" 23 апреля 2017 не покажут по федеральным каналам нашей страны, но следить за поединком онлайн можно будет в Сети.', 'data:image/tmp;base64,', '2017-04-23 18:41:09', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(107, 'КАК СТАЛИН КАДРОВУЮ ПОЛИТИКУ ПРОВОДИЛ', 'Не секрет, что различного рода штампы свойственны историческому сознанию. Многие склонны поддерживать стереотипы, прочно укоренившиеся относительно, хорошо известных, казалось бы, событий прошлого. В полной мере это относится к восприятию большевистской партии. Ее образ как антинациональной силы, сформированной преимущественно из инородческих кадров, господствует в сознании современников. Причем считается, что ярко выраженное инородческое «лицо» большевиков, было присуще им все долгие десятилетия пребывания у власти. Этот расхожий образ – важный элемент нынешней патриотической доктрины. Однако в действительности дело обстояло гораздо сложнее, чем представляется сегодня.\r\n\r\nКонечно, в первые дореволюционные годы в большевистской партии преобладали представители национальных меньшинств, которых свела вместе ненависть к царской России. Возьмем биографические данные 41–42 томов Энциклопедического словаря Гранат, составленных в 1925–1926 годах. Здесь содержатся сведения о 245-ти большевистских лидерах и активистах с дореволюционным стажем. Из них более 2/3 относятся к представителям различных национальностей, находившихся ранее под скипетром Российской империи. Заметим, что из числа партийцев русского происхождения – оставшихся 30% – лишь половина (15%) из рабочих и крестьян. Поэтому ни о каком русском начале в большевистской элите до- и послереволюционной поры не могло быть и речи. На партсъездах, собиравших функционеров разного уровня, первую скрипку играли кадры, большую долю которых составляли представители еврейской национальности. Если на конец Гражданской войны в рядах РКП(б) в целом состояло только 5,2% евреев, то среди делегатов ХI съезда партии (1922 год) их насчитывалось уже больше трети, а среди избранных съездом членов Центрального комитета – 26%. Весомым было присутствие прибалтийцев, поляков, кавказцев. Нерусское представительство значительно и в персональном составе коллегий наркоматов. К примеру, в 1919 году из 127 человек (наркомы, их заместители, начальники департаментов) русских фамилий только 34, или чуть более 30% верхов Совнаркома принадлежало к титульной нации. К тому же среди этих русских преобладали представители дворянской и разночинной интеллигенции, отпрыски мелких и средних купцов; выходцев непосредственно из рабоче-крестьянских слоев практически не было. То есть, все значимые государственные должности были распределены между интеллигентами наиболее приспособленными, как считалось, к руководящей работе. А потому о каких-либо связях правящей партии с русским народом говорить не приходится. \r\n\r\nЕго представители выступали лишь в роли партийной массовки. Так, из рабочих один лишь А.Г. Шляпников в первом большевистском правительстве ненадолго получил пост министра труда; вскоре его сменил В.В. Шмит (немец по национальности). Но так продолжалось недолго. По завершении Гражданской войны на повестку дня встал вопрос: кто будет определять хозяйственную жизнь страны? И рабочие-коммунисты дореволюционного призыва не стали довольствоваться положением статистов, предъявив претензии на кардинальный пересмотр своих позиций. Этот внутрипартийный бунт известен как «рабочая оппозиция» в РКП(б). Она сформировалась в недрах производственных профсоюзов. Ее лидеры – неизменные участники партийных съездов – начали претендовать на весомые роли в управлении экономикой. С национальной точки зрения эти выходцы из пролетарской среды в подавляющем большинстве были этническими русскими. Назовем А.Г. Шляпникова, С.П. Медведева, А.С. Киселева, Г.И. Мясникова, И.И Кутузова, Ю.Х. Лутовинова и др. Эта незначительная группа энергично потребовала отстранения большевистской интеллигенции и старых специалистов от административных рычагов.\r\n\r\nПравда, отнести этих бывших рабочих к истинно русским патриотам еще нельзя. Конечно, они – из пролетарских слоев индустриальных регионов России. Но длительное пребывание в социал-демократических кругах наложило на них неизгладимый отпечаток. Тот же Шляпников несколько лет провел за границей, впитывая революционные ожидания; Ю.Х. Лутовинов из-за недостаточного напора революции – покончил жизнь самоубийством; в последний путь его провожали революционеры, включая Троцкого, озабоченные той же проблемой. Верхи «рабочей оппозиции» ориентировались в первую очередь на постулаты марксистской классики, а не на русское национальное начало, которое сколько-нибудь внятно у них не звучит. Гораздо больше они переживали о задержке мировой революции, и авторитет Коммунистического Интернационала никогда не ставился ими под сомнение.\r\n\r\nТем не менее, бунт «рабочей оппозиции» основательно потряс правящую партию, неизменно провозглашавшую себя пролетарской. Эти события показали, что партийное руководство не может рассчитывать на прежнюю массовку. Поэтому после смерти Ленина были проведены масштабные кампании по привлечению в партию новых сил из народа. В итоге в ВКП (б) влились кадры, не вкусившие социал-демократических истин, насквозь пропитанные неприязнью к интеллигенции, включая партийную, и преисполненные не духом интернациональной солидарности (о котором имели весьма слабое представление), а сознанием национальной исключительности. Н.К. Крупская, соприкоснувшись с новым пополнением, подметила, что те «отождествляют интеллигентов с крупными помещиками и с буржуазией»; ненависть к интеллигентам очень сильна, ничего подобного не встретишь за границей, – заключала она. Не заставил себя ждать и всплеск антисемитизма. Старые партийцы недоумевали: почему это происходит при советской власти?! Раньше эти настроения сознательно разогревал царизм, дабы одурять простонародье, но теперь снова нарастают волны этого низменного чувства. Причем, не только в несознательных, отсталых слоях, но и в недрах партийно-советского аппарата. \r\nНаводнившие партию кадры с пролетарской закваской, нацеливались на восхождение по партийно-государственной лестнице. Неосвоенного аппаратного пространства для них было более, чем достаточно. Например, в 1928 году из 31 тыс. ответственных должностей центрального госаппарата всего 8% были заняты выходцами из рабочих, остальные же 92% – служащими, причем лишь четверть этих функционеров состояла в партии. Стремясь к карьерному росту, коммунисты из рабочей среды к концу 20-х заполнили высшие партийно-образовательные учреждения. Так, если в институте красной профессуры в первых приемах (1921-1923) доля рабочих никогда не превышала 10%, а до выпуска добиралось не более 2%, то на рубеже 20-30-х годов было принято решение увеличить число слушателей из рабочих до 70-75%. Официально курс на продвижение партийцев, вышедших из рабочей среды, на руководящие посты разного уровня был провозглашен ХVI конференцией ВКП (б), прошедшей в апреле 1929 года. По сути, это означало воспроизведение идей, выдвигавшихся, в свое время, «рабочей оппозицией». Только теперь в партийных рядах коммунистов рабоче-крестьянского происхождения было уже большинство. их карьерное восхождение становилось делом ближайшего будущего. Именно это большинство превращалось в главный инструмент сталинского возвышения.\r\n\r\nОборотной стороной политики «большого террора» стало масштабное обновление партийно-государственной элиты СССР, чему посвящено громадное количество литературы у нас и за рубежом. Так, среди участников XVIII съезда партии (1939) делегатов со стажем до 1920 года оказалось менее 20%. Зато коммунистов Ленинских призывов (1924–1928) – 45,3%, а вступивших еще позднее – 30,6%; то есть в общей сложности 76% партийцев представляли новое поколение. Особенно поражают изменения в составе Центрального комитета: на XVIII съезде (по сравнению с XVII и при той же примерно общей численности) сменилось не менее 115 из 139 его членов. Причем эти сдвиги знаменовали кадровую стабилизацию: из нового состава ЦК при жизни Сталина выбыло лишь 11 человек, или 7%.\r\n\r\nНа авансцену вышла совсем другая партия, где первые роли играли 35-летние технократы. В отчетном докладе ЦК ХVIII съезду ВКП(б) Сталин выражал удовлетворение тем, что отныне «молодые кадры составляют громадное большинство», так как они «в избытке обладают чувством нового». На них делалась основная ставка в набирающем небывалые темпы хозяйственном строительстве. Это обусловило реорганизацию партийного аппарата, ликвидацию в нем производственно-отраслевых отделов. Как заявил А.А. Жданов, они «не знают, чем им, собственно, надо заниматься, допускают подмену хозорганов, конкурируют с ними, а это порождает обезличку и безответственность в работе». Теперь центром управления экономикой становится не партия, а правительство, состоящее из профессиональных управленцев. Неслучайно перед войной пост главы Совнаркома занял сам Сталин. Если с 1929 и вплоть до 1938 года пленумы ЦК проводились по два-четыре раза в год, то в 1939–1953 годах состоялось только одиннадцать пленумов, а в некоторые годы (1942–1943, 1945, 1948, 1950–1951) их не было вообще. По завершению «большого террора» изменился не просто партийный состав; под прежней вывеской ВКП(б) оказалась партия, которая напрочь утратила прежний облик. В новой партийно-государственной верхушке присутствие «инородцев» резко сократилось. Например, евреев теперь, что называется, можно сосчитать по пальцам: Б.Л. Ванников, С.М. Гинзбург, еще, конечно, Л.М. Каганович – член Политбюро, нарком транспорта (хотя, как тогда говорили, «евреи его не любили», то есть не признавали за своего). Попадались представители армян: тот же А.И. Микоян, известный металлург И.Ф. Тевосян, А.М. Петросьянц – замнаркома тяжелого машиностроения. В сталинской номенклатуре практически отсутствуют этнические украинцы (исключение – нарком судостроительной промышленности Носенко, цветной металлургии Ломако). Говоря о плеяде руководителей, выдвинутых Сталиным, снова уместно вспомнить «рабочую оппозицию» 1920–1922 годов, стремившуюся взять бразды хозяйственного управления в свои руки. Эти претензии выглядели, мягко говоря, несерьезными: оппозиционеры не обладали ни необходимыми знаниями, ни компетенцией. Сталин понимал, что их порывы не только бесперспективны, но и чреваты негативными последствиями для экономики. Однако к 1939 году он фактически реализовал то, о чем грезило предыдущее пролетарское поколение. Теперь руководство экономической жизнью переходило в руки тех, кто, также выйдя из недр рабочего класса, получил образование и прошел управленческую вертикаль. Эти технократы были способны не просто руководить предприятиями, но и преображать их в соответствии с требованиями времени. Важно и еще одно обстоятельство: новые сталинские выдвиженцы были русскими. Они внесут решающий вклад в победу в Великой Отечественной войне и в строительстве великой мировой державы.', 'data:image/tmp;base64,', '2017-04-23 18:42:12', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(108, 'Генсек ОБСЕ призвал все стороны участвовать в расследовании подрыва машины', '"Все стороны несут ответственность за защиту и безопасность наблюдателей ОБСЕ. Миссия должна получать повсеместную поддержку, и все должны вновь подтвердить обязательства по ее целям, а также защищать наблюдателей от угрозы. ОБСЕ начала расследование инцидента и надеется на максимальное взаимодействие всех заинтересованных сторон", - сказано в заявлении генсека, которое распространила пресс-служба ОБСЕ.\r\n', 'data:image/tmp;base64,', '2017-04-23 18:43:41', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(109, 'Ученые восстановили облик женщины, жившей 13 тысяч лет назад', 'Ученые восстановили облик женщины, которая жила в Таиланде 13 тысяч лет назад. Ее лицо существенным образом не отличается от современных представительниц прекрасного пола из Юго-Восточной Азии, сообщается в журнале Antiquity.\r\n\r\nАвстралийские ученые разработали методику реконструкции лица, которая опирается на статистические данные соотношения толщины мускулов лица и костей черепа в разных его точках.\r\n', 'data:image/tmp;base64,', '2017-04-23 18:44:43', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(110, 'Ученые назвали лучший возраст для родов. Женщины, вы будете удивлены!', 'Для того чтобы родить здорового ребеночка и самой не подорвать здоровье при родах, врачи рекомендуют женщине тщательно подходить к вопросу планирования семьи. И немаловажную роль в этом играет возраст будущей матери. До недавнего времени в медицине термин «старородящая» относился к женщинам, которые впервые рожали после 25 лет! Считалось, что идеальный возраст будущей матери 20–27 лет. Но последнее открытие ученых опровергло все эти теории.b245af1745\r\n\r\nО том, в каком возрасте лучше всего рожать, ведется немало споров. С одной стороны, молодые мамы имеют более крепкое здоровье, а их яйцеклетки еще не успели подвергнуться такому количеству вредных влияний окружающей среды, как яйцеклетки более зрелых женщин. Но, с другой стороны, с каждым годом женщины все позже вступают в брак и все больше внимания уделяют собственной карьере, путешествиям и беззаботной юности.\r\n\r\nВопреки распространенному мнению, что лучший возраст для рождения первенца — это промежуток от 20 до 27 лет, открытие доктора Джона Мировски из Техасского Университета утверждает, что идеальным возрастом является 34 года. Вот несколько аргументов.\r\n\r\n34 года – оптимальный возраст для женского организма, чтобы зачать и выносить здорового ребенка. Кроме того, в более молодом возрасте у женщин чаще случаются различные болезни и состояния, которые могут осложнить роды. В защиту этой теории выступили и психологи, чьи исследования подтверждают, что женщины за 30 обычно находятся в более серьезных отношениях с партнером, имеют стабильный заработок и достаточно жизненного опыта, чтобы лучше воспитать малыша.\r\n\r\nОднако врачи предостерегают женщин, что после 35 лет возрастает риск осложнений и развития хронических заболеваний, в том числе и заболеваний репродуктивной системы, поэтому в этом возрасте женщины должны планировать беременность под строгим наблюдением врачей.\r\n\r\nВ каком бы возрасте вы ни планировали создать семью, помните о том, что появление ребенка — это очень ответственное решение, которое наверняка изменит всю вашу жизнь. Поэтому подходить к нему нужно с большой серьезностью.', 'data:image/tmp;base64,', '2017-04-23 18:45:47', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(111, 'Артемий Лебедев закрывает фирменное кафе в Петербурге', 'Дизайнер Артемий Лебедев объявил о закрытии своего кафе на улице Жуковского в Санкт-Петербурге. Причины своего решения блогер не уточняет.', 'data:image/tmp;base64,', '2017-04-23 18:47:11', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(112, 'ТАЛИБЫ АТАКОВАЛИ ВОЕННУЮ БАЗУ ПРАВИТЕЛЬСТВЕННЫХ СИЛ В МАЗАРИ-ШАРИФЕ', 'о время нападения на военную базу в пригороде Мазари-Шарифа на севере Афганистана боевики движения «Талибан» убили как минимум 140 афганских военнослужащих.\r\n\r\nПо сообщениям афганских властей террористы перед нападением переоделись в форму правительственной армии. Само нападение произошло, когда солдаты выходили из мечети на территории базы после пятничной молитвы. Боевики также расстреляли солдат, находившихся в столовой. Резня в Мазари-Шарифе продолжалась до глубокой ночи.\r\n\r\nОфициально пока озвучена цифра в 140 погибших военных, но многие из выживших тяжело ранены и количество жертв может вырасти. Это самые большие потери при нападении на военную базу в Афганистане с начала конфликта.\r\n\r\nСам «Талибан» заявил, что нападавшие подразделения использовали подрывников-самоубийц, чтобы прорвать внешний периметр обороны базы. Также озвучены потери нападавших - десять человек.', 'data:image/tmp;base64,', '2017-04-23 18:48:31', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(113, 'ВЕЛИКОБРИТАНИЯ ПРОЖИЛА СУТКИ БЕЗ УГОЛЬНОЙ ЭЛЕКТРОГЕНЕРАЦИИ', '21 апреля Великобритания смогла целые сутки прожить, не используя уголь для производства электричества. Это Туманному Альбиону удалось впервые с 1882 года, когда в Лондоне был запущен первый централизованный угольный генератор.\r\n\r\nНа протяжении нескольких лет англичане потихоньку отучают электросистему страны от потребления угля - в мае 2016 года такой диеты удалось придерживаться 19 часов. Подобный результат повторен 20 апреля 2017 года.\r\n\r\n «Великобритания использует очень разные и гибкие источники электричества. Наша энергетическая система продолжает изменяться, и National Grid адаптируется под эти изменения», - сказала представитель национального оператора электроэнергии National Grid Корди О''Хара.\r\n\r\nПостепенно снижается и общий показатель использования угля. В 2016 году на долю угля пришлось всего 9% производства электроэнергии, тогда как годом ранее его доля составляла 23%.\r\n\r\nК 2025 году британское правительство планирует поэтапно закрыть или перепрофилировать последние в стране электростанции, работающие на угле, чтобы сократить выбросы в атмосферу.\r\n\r\nВ июле 2016 года специалисты Всемирного фонда дикой природы и других организаций подготовили доклад, согласно которому ущерб от работы угольных электростанций в Европе оценивается в 23 тыс. преждевременных смертей в год. На конец 2015 года в ЕС работали 280 угольных электростанций. На уголь в 2015 году пришлось 24% электроэнергии, вырабатываемой в ЕС. Доля угля в энергетике Европы сокращается, но пока некоторые страны, включая Польшу и Чехию, не планируют полностью отказаться от этого вида электроэнергии.\r\n\r\nЗа первое полугодие прошлого года в украинской энергостистеме около 40% электроэнергии производилось с использованием угля.', 'data:image/tmp;base64,', '2017-04-23 18:49:06', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(114, 'СТОИМОСТЬ РЕМОНТА «АДМИРАЛА КУЗНЕЦОВА» ВЫРОСЛА ДО 40 МИЛЛИАРДОВ РУБЛЕЙ', 'Ремонт Авианосца начнется в сентябре на заводе «Звездочка» под Мурманском. И цену на него вроде как уже согласовали, но еще не официально.\r\n\r\nПо словам источника ТАСС, на корабле отремонтируют всю электромеханическую часть и будет модернизирован взлетно-посадочный комплекс. Видимо, ребята из «Звездочки» таки нашли в интернете действенный способ обеспечить рост взлетно-посадочного комплекса на 10+ см в неделю.\r\n\r\nПо данным издания «Звездочка» подпишет с флотом контракт на второй этап ремонта и модернизации авианосца уже в сентябре. «Цена сделки уже согласована — это почти 40 миллиардов рублей. Работы начнутся в том же месяце на 35-м судоремонтном заводе в Росляково под Мурманском», — рассказал источник.\r\n\r\nА вот месяц назад называли суммы от 20 до 65 млрд рублей. Глядишь, за следующие три месяца до подписания контракта догонят стоимость ремонта вейпера до 80 или даже 100 млрд рублей. Стал корабль на ремонт еще в начале марта. Тогда обещали всё закончить к 2020 году.\r\n\r\nВ своей любимой манере российский ОПК продолжает потрясать гипотетическим усилением и обещает установить на плавучем дымогенераторе ракетный комплекс «Калибр-НК». Также грозятся унифицировать пусковые установки под запуск сверхзвуковых крылатых ракет «Оникс» и гиперзвуковых «Циркон».\r\n\r\nНу и вдобавок, хвастаются вертолетами, которые разместят на «Адмирале Кузнецове» - Ка-52К и Ка-29. Видимо, самолеты оттуда всё еще небезопасно запускать, хотя с момента принудительного ввода корабля в эксплуатацию прошло уже 25 лет.', 'data:image/tmp;base64,', '2017-04-23 18:50:11', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(115, 'ТЕРРОРИСТЫ ИЗ ДОНЕЦКА НАНЯЛИ БЕЗРАБОТНОГО РАЗРИСОВЫВАТЬ ХУНТЕ ПАМЯТНИКИ', 'В селе Лебединское под Мариуполем местные жители задержали на близлежащем кладбище человека с баллончиком краски. Как выяснилось в ходе общения без повреждений – он разрисовывал могилы солдат «нацистскими символами».\r\n\r\nНакануне даты окончания Второй мировой войны, когда уровень «дедовоевальского» угара у пророссийских террористов и им сочувствующих достигает апогея, энергию ненависти просто необходимо куда-то направить. Поэтому приходится искать поводы покричать «Можем повторить». А если их нет - то можно создать и самим.  Видимо, примерно такой логики придерживался знакомый задержанного безработного.', 'data:image/tmp;base64,', '2017-04-23 18:51:24', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(116, 'ЛОЛИТЕ МИЛЯВСКОЙ ЗАПРЕТИЛИ ВЪЕЗД В УКРАИНУ', 'Российскую певицу Лолиту Милявскую у которой есть украинские корни (но она к ним не прислушивается) сегодня в 4 утра сняли с поезда в Конотопе.\r\n\r\nКак говорит певица ртом на видео, размещенном в в Instagram она ехала в Украину, чтобы проведать своего больного ребенка. Но при паспортном контроле её сняли с поезда «за посещение Керчи в 2015 году».\r\n\r\nПевица и ранее не отличалась хотя бы нейтральностью к современной Украине и даже заявляла, что готова есть только российские продукты после введения санкций против России.\r\n\r\nОстается непонятным только одно – если тут так плохо и можно выжить даже на одних российских продуктах, то зачем до сих пор держать семью в стране, настоящее и будущее которой тебе не по душе?', 'data:image/tmp;base64,', '2017-04-23 18:52:09', 2);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(117, 'В Тель-Авиве в районе площади Атарим, вооруженный ножом палестинский араб напал на прохожих и ранил ', 'В Тель-Авиве в районе площади Атарим, вооруженный ножом палестинский араб напал на прохожих и ранил четырех человек.\r\n\r\nРадиостанция «Решет Бет» сообщила, что террорист зашел в холл гостиницы Herods со стойки регистрации схватил острый предмет, с помощью которого атаковал трех работников отеля. Затем он выбежал на улицу. На улице он ранил еще одного человека.\r\n\r\nНападавший, 18-летний араб из Шхема, задержан и передан следователям Общей службы безопасности для дальнейшего расследования, сообщает newsru.co.il.\r\n\r\nВсех пострадавших доставили в больницу: двух 50-летних мужчин и женщину недалеко от гостиницы Herods, и 70-летнего мужчину с площади Атарим.\r\n\r\nДо приезда полиции прохожие пытались задержать террориста собственными силами. Мэр города Рон Хульдаи поблагодарил всех тех, кто пытался задержать террориста.', 'data:image/tmp;base64,', '2017-04-23 18:53:26', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(118, 'Украинская сторона выражает соболезнования родным', 'Инцидент произошел сегодня утром. Подорвался один из двух следовавших из Славяносербска автомобилей СММ ОБСЕ.\r\n\r\n«Украинская сторона СЦКК сообщает, что сегодня при осуществлении патрулирования в районе населенного пункта Пришиб, территория ОРЛО, вероятно на мине подорвался автомобиль Специальной мониторинговой миссии ОБСЕ. По предварительным данным среди группы СММ ОБСЕ есть погибшие и раненые», - сообщает пресс-центр АТО.\r\n\r\nУкраинская сторона выражает соболезнования родным и близким пострадавших, а также заявляет, что в указанное время по данным очередных изменений режим прекращения огня придерживался как с украинской стороны, так и со стороны НЗФ ОРЛО.', 'data:image/tmp;base64,', '2017-04-23 18:54:43', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(119, 'Вчера вечером недалеко от расположения самой воинской части ', 'В Гюмри, где находится 102-ая российская военная база, возле магазина нашли труп зарезали российского военнослужащего-контрактника.\r\n\r\nВчера вечером недалеко от расположения самой воинской части в Гюмри гражданский нанес удар ножом российскому контрактнику. Конфликт произошел между 21-летним российским военнослужащим и 20-летним местным жителем. По предварительным данным, убийство совершено на бытовой почве.\r\n\r\n«В результате нанесенной ножевой раны военнослужащий скончался на месте. Совершивший нападение на российского военнослужащего задержан полицией города Гюмри. По факту происшествия командованием штаба военного округа совместно с местными правоохранительными органами проводится расследование», -  сообщили в пресс-службе Южного военного округа.\r\n\r\nВидимо, после дела Пермякова, местные жители не особо жалуют российских военных.', 'data:image/tmp;base64,', '2017-04-23 18:55:16', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(120, 'США И ЯПОНИЯ НАЧАЛИ СОВМЕСТНЫЕ УЧЕНИЯ', 'В Тихом океане начались учения, в которых принимают участие авианосная группа США и Силы самообороны Японии. Американское подразделение, которое после учений подойдет ближе к берегам КНДР, возглавляет авианосец «Карл Винсон».\r\n\r\nУчения будут продолжаться в течение нескольких дней. Согласно сообщению японских СМИ, корабли страны Восходящего солнца соединились с ударной авианосной группой США в западной части Тихого океана около Филиппин.\r\n\r\nЦель учений - оказание давления на Северную Корею в условиях продолжающихся испытаний баллистических ракет. Кроме того, американские и японские моряки должны отработать свое взаимодействие. После завершения учений, ударная авианосная группа США будет развернута у Корейского полуострова.\r\n\r\n Планы США, предсказуемо не устраивают северокорейского лидера, и в КНДР уже заявили, что готовы уничтожить авианосец.\r\n\r\n«Наши революционные силы готовы сразиться с одним ядерным авианосцем США с помощью одного удара», - заявили в правящей партии Северной Кореи. Ну или на крайний случай подменят темной ночью «Карла Винсона» на «Адмирала Кузнецова», а потом скажут – что именно так выглядит американский авианосец после ракетного удара по нему.', 'data:image/tmp;base64,', '2017-04-23 18:55:50', 31);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(121, 'Українська сторона припинить постачання електроенергії в ОРДЛО 25 квітня', 'Українська сторона припинить постачання електроенергії в ОРДЛО 25 квітня\r\nЕлектропостачання непідконтрольних територій припиниться 25 квітня Луганське енергетичне об''єднання припинить постачання електроенергії на тимчасово непідконтрольні території Україні на Донбасі з 25 квітня 2017 року. Про це повідомив гендиректор Луганського енергетичного об''єднання Володимир Грицай в ефірі каналу "ЛОТ". "З 25-го квітня буде повністю припинено перетік електроенергії на неконтрольовану територію. Зараз наші технічні служби проводять певні заходи, і з 25 квітня, з 00:00 електропостачання повинно бути повністю відключено", - заявив Грицай. За його словами, отримані документи від ДП "Енергоринок", які підтверджені документами Міністерства палива та енергетики за підписом міністра Ігоря Насалика про те, що з 25 квітня перетікання буде повністю припинено. "В даний перетікання потрапляє і повністю Попаснянський водоканал", - резюмував Грицай.\r\n', 'data:image/tmp;base64,', '2017-04-23 18:57:01', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(122, 'Меркель закликала якнайшвидше розслідувати підрив патруля ОБСЄ на Донбасі', 'Канцлер Німеччини Ангела Меркель закликала якнайшвидше розслідувати підрив патруля місії ОБСЄ на Луганщині та очікує, що сторони конфлікту на Донбасі зроблять усе можливе для з''ясування обставин трагедії.\r\nПро це Меркель заявила 23 квітня, повідомляє DW.\r\n"Федеральний уряд очікує, що усі сторони конфлікту якнайшвидше зроблять усе можливе, щоб з''ясувати, яким чином могла статись ця трагічна подія, та притягнути до відповідальності винних у цьому", - заявила Меркель, інформує dpa.\r\nТакож Меркель закликала сторони конфлікту на Донбасі повною мірою дотримуватись режиму "тиші".\r\nЯк відомо, в результаті підриву автомобіля Спеціальної моніторингової місії ОБСЄ на території ОРЛО один з членів місії загинув, двох доставлено до лікарні для подальшого обстеження.\r\nЗа даними МЗС України та Австрії, загиблий - медпрацівник з США, поранення отримала громадянка Німеччини. \r\nОдин з представників бойовиків ОРЛО Владислав Дейнего заявив, що українські військові обстрілюють район підриву автомобіля патруля СММ ОБСЄ в околицях с. Пришиб Слов''яносербського району, "таким чином українська сторона заважає проведенню слідчих дій".\r\nВ МЗС України заявили, що підрив патруля місії ОБСЄ є підтвердженням спроб Москви залякати спостерігачів ОБСЄ та звести нанівець зусилля України та СММ щодо стабілізації ситуації на лінії розмежування.', 'data:image/tmp;base64,', '2017-04-23 18:57:58', 62);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(123, 'Вибори президента Франції', 'У другий тур президентських виборів попередньо проходять Еммануель Макрон і Марін Ле Пен Колишній міністр економіки, лідер партії "Вперед!" Еммануель Макрон та лідер праворадикальної партії "Національний фронт" Марін Ле Пен виходять до другого туру виборів президента у Франції. Про це свідчать дані екзит-полу, проведеного компаніями Ipsos/Sopra Steria у партнерстві з France Tеlеvisions, Radio France, RFI та France24, й опублікованого одразу після закриття виборчих дільниць, передає DW. Згідно з цими даними, Макрон у першому турі президентських виборів, який відбувся 23 квітня 2017 року, набрав 23,7% голосів виборців, а Ле Пен - 21,7%. Представник партії "Республіканці", екс-прем''єр Франсуа Фійон та крайній лівий кандидат Жан-Люк Меланшон набрали однакову кількість голосів - 19,5%. Зазначено, що попередні екзит-поли бельгійських медіа показували схожі результати: Макрон - 24%, Ле Пен - 21% та Фійон - 21%. Як відомо, другий тур президентських виборів у Франції відбудеться за два тижні, 7 травня 2017 року. Нагадаємо, раніше повідомлялося, що, згідно з даними опитування, проведеного телеканалом RTBF, у першому турі президентських виборів у Франції лідирують Еммануель Макрон і Марін Ле Пен.\r\n', 'data:image/tmp;base64,', '2017-04-23 18:58:40', 85);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(124, 'На початку тижня в Україні ще буде холодно, в понеділок - дощі', 'У найближчу добу погоду України продовжить визначатиме холодна повітряна маса, повідомляє в неділю Укргідрометцентр.\r\n\r\nУ понеділок по країні пройдуть дощі, в Карпатах з мокрим снігом, у східній частині сильні дощі, лише в північних областях без опадів. Вітер північно-західний, 5-10м / с.\r\n\r\nТемпература повітря вночі 1-6° тепла, в північних і західних областях на поверхні грунту та місцями повітрі заморозки 0-5°, удень 8-14° тепла, на високогір''ї Карпат вночі 2-7° морозу, вдень 0-5° тепла.\r\n\r\nУ Києві - без опадів, температура повітря вночі 1-3° тепла, на поверхні грунту заморозки 0-2º, вдень 10-12° тепла.\r\n\r\nЗа даними Центральної геофізичної обсерваторії в Києві 24 квітня найвища температура вдень була 27,0 в 1950р., Найнижча вночі -2,2 в 1893р.\r\n\r\nНа 25 квітня в Україні очікується погода без опадів. Вітер вночі західний, 5-10 м / с, удень південно-західний, 7-12 м / с, місцями пориви 15-20 м / с, на високогір''ї Карпат до 25 м / с.\r\n\r\nВночі, крім крайнього півдня, заморозки 0-5 °, удень температура повітря 13-18 ° тепла.\r\n\r\nУ Києві - без опадів, вночі заморозки 0-2º, вдень температура повітря 15-17 ° тепла.', 'data:image/tmp;base64,', '2017-04-23 18:59:16', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(125, 'Абонплата', 'Абонплата для Фiрташа 23.04.2017 14:55 Так у народi назвали платiж, який хоч тимчасово й вiдтермiнований,  але незабаром знову з''явиться у платiжках за газ, пише газета "Експрес".    Нацiональна комiсiя, що здiйснює регулювання у сферах енергетики та комунальних послуг, вiдтермiнувала своє рiшення про встановлення з 1 квiтня так званої абонплати за газ -- дуже велика хвиля обурення прокотилася країною. А ще з''явилось народне визначення цiєї абонплати -- "податок Фiрташа" Виявляється, саме вiн контролює бiльшiсть мереж, якими  голубе паливо потрапляє в нашi оселi.    Вiдповiдно, i грошi вiд нової абонплати мали потрапляти йому просто до кишенi.   Про це неодноразово казав i сам голова правлiння НАК "Нафтогаз України" Андрiй Коболєв. "У нас є проблема -- монополiя пана Фiрташа. I саме усунення цiєї монополiї є важливим елементом побудови всього ринку", -- зазначив вiн.   -- Чи велику частку цього ринку контролює Дмитро Фiрташ?    -- Частка його власностi в облгазах країни -- у межах 70 -- 80%, -- каже Сергiй Дяченко, експерт з енергетичних питань. -- Щоправда, облгази -- доволi  умовна назва, бо ранiше це були пiдприємства з газорозподiлу та газифiкацiї. Потiм їх роздiлили на постачальникiв i транспортних операторiв. I тому тепер ми говоримо про Фiрташа як про власника транспортних операторiв України (розподiльчих мереж). Вiн контролює рiзнi пакети акцiй. Дуже незначна їх частина залишилася в держави.   Тобто державна компанiя "Укртрансгаз" транспортує газ вiд видобувної компанiї чи вiд iмпортера по газотранспортнiй системi. Пiсля цього паливо потрапляє в газорозподiльчi системи (здебiльшого -- Фiрташевi). Через них газ надходить до споживачiв.   -- Статистичної точностi щодо частки Фiрташа на ринку газу не буде, оскiльки кiнцевий власник схований за офшорами, -- додає Михайло Гончар, президент Центру глобалiстики "Стратегiя ХХI".   -- Як Фiрташ став монополiстом?   С. Дяченко: -- Вiн поступово скуповував облгази, приватизованi в 1996 роцi. Власне, всi нашi теперiшнi негаразди починаються з тiєї недолугої приватизацiї стратегiчних об''єктiв трудовими колективами. Уже через рiк усi акцiї були закумульованi приватними структурами, здебiльшого росiйськими. Приблизно у 2002 роцi цi пакети стали перекуповувати на внутрiшньому ринку України. I тодi Фiрташ захопив чималу частку.   -- Як вiн змiг досягнути цього?   М. Гончар: -- Спочатку його "РосУкрЕнерго" в 2004 -- 2009 роках була посередником у постачаннi газу в Україну та ЄС. Тодi з''явил\r\nЧитайте більше тут: http://expres.ua/news/2017/04/23/239082-abonplata-firtasha', 'data:image/tmp;base64,', '2017-04-23 19:01:56', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(126, 'United Airlines через скандал з пасажиром змінить систему бонусів', 'Авіакомпанія United Airlines, що опинилася в центрі скандалу після насильницького виселення пасажира з борту літака, заявила, що відтепер виплата винагород менеджменту буде тісно пов''язана з задоволеністю клієнтів наданими послугами.', 'data:image/tmp;base64,', '2017-04-23 19:02:31', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(127, 'Аеропорт "Київ" призупинив перемовини з Ryanair', 'Міжнародний аеропорт "Київ" тимчасово призупинив діалог з найбільшим європейським лоукостером Ryanair.\r\nПро це заявив голова ради директорів аеропорту "Київ" Денис Костржевський у інтерв’ю "Українським новинам".\r\nЗа його словами, Ryanair очікує, що аеропорт "Київ" знизить аеропортовий збір у середньому на 60-80%. Однак в Україні цей збір є регульованим тарифом, в який входить вартість палива, опалення, зарплата персоналу та інше.\r\nЗа словами Костржевського, в Європі є державні дотації для аеропортів, в Україні такого немає.', 'data:image/tmp;base64,', '2017-04-23 19:03:14', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(128, 'Великобританія вийде з п''ятірки найбільших економік світу', 'До 2022 році Великобританія покине список п''яти найбільших економік світу, передає Ukr.Media.\r\n\r\nЗа прогнозами МВФ, Індія, темпи економічного зростання якої складають 9,9% в рік, до 2022 року буде займати четверте місце в світі, обігнавши і Великобританію (нині п''яте місце в світі) і Німеччину (четверте місце).\r\n\r\nВ результаті Великобританія, темпи економічного зростання якої, за прогнозами МВФ, складуть в поточному році 2%, а в наступному - 1,8%, залишиться за межами п''ятірки. Додатковий негативний вплив на економіку країни буде надавати і вихід Сполученого Королівства з Євросоюзу.\r\n\r\nНагадаємо, Єврокомісія виставить Сполученому королівству рахунок в розмірі близько 50 млрд фунтів стерлінгів ($62 млрд), і Великобританія зможе остаточно покинути ЄС тільки після його сплати.', 'data:image/tmp;base64,', '2017-04-23 19:03:59', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(129, 'В Ізраїлі розробляють чотиримісний "літаючий автомобіль', 'зраїльська компанія Urban Aeronautic, що спеціалізується на розробці і виробництві безпілотних літальних апаратів з вертикальним злетом і посадкою (ЗВЗП), займеться розробкою літаючого автомобіля в рамках стартапу Metro Skyway, повідомляє The Verge. Передбачається, що чотиримісний транспортний засіб під назвою CityHawk буде літати на реактивному авіаційному паливі, в перспективі розробники планують "перевести" його на рідкий водень. Однак спочатку технологія повинна стати комерційно придатною і не вибухонебезпечною. CityHawk стане вже другим проектом літаючого автомобіля ізраїльської компанії Urban Aeronautics. Автомобіль з''явиться на ринку вже через п''ять років. В основі апарату лежить запатентована Urban Aeronautics система внутрішніх роторів, вбудованих у фюзеляж. Аналогічна система використовується в іншому літаючому автомобілі компанії - Cormorant, який буде представлений на ринку у 2020 році. В даний час CityHawk проходить випробування на авіабазі в Ізраїлі. Пасажирський дрон планується використовувати для евакуації людей із зон лиха та з території військових дій.\r\nБільше читайте тут: http://dt.ua/TECHNOLOGIES/v-izrayili-rozroblyayut-chotirimisniy-litayuchiy-avtomobil-240614_.html', 'data:image/tmp;base64,', '2017-04-23 19:05:19', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(130, 'Рейтинг 100 найбагатших Українців', 'Рейтинг 100 найбагатших Українців за підсумками 2016 року, складений журналом "Фокус", в черговий раз очолив власник групи СКМ Рінат Ахметов, статок якого оцінюється у 2,2 млрд доларів. Друге та третє місце в рейтингу, як і рік тому посіли співвласники групи "Приват" Ігор Коломойський (1,2 млрд доларів) та Геннадій Боголюбов (1,2 млрд доларів), передає Ukr.Media.\r\n\r\nЧетверте місце посів власник EastOne Віктор Пінчук (1,1 млрд доларів). На п''яте місце, за підсумками минулого року, з 10 позиції піднявся власник "Кернел Груп" Андрій Веревський (871 млн доларів); Власник "Миронівського хлібопродукту" Юрій Косюк, що посів п''яте місце в минулорічному рейтингу, опустився на шосте місце (738 млн доларів).\r\n\r\nНа сьоме місце з шостого змістився власник DCH Group Олександр Ярославський (4 млн); на восьме місце з 18 позиції піднявся власник Ferrexpo Костянтин Жеваго (5 млн).\r\n\r\nДев''яте місце в рейтингу, як і торік, займає власник Group DF Дмитро Фірташ (623 млн долларів). Президент України та власник Roshen Петро Порошенко посів 10 місце (589 млн), змістившись на нього з восьмої позиції.', 'data:image/tmp;base64,', '2017-04-23 19:06:10', 0);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(131, 'В автопромі назріває чергова технологічна революція, яка переверне все з ніг на голову Читайте більш', 'Японська корпорація Toyota планує створювати потужні вантажівки, що будуть оснащені силовими установками на водневих паливних елементах. Заявлена ініціатива має назву Project Portal. Тестуватимуть водневі вантажівки в порту Лос-Анджелеса, США, пише Екотавн.\r\n', 'data:image/tmp;base64,', '2017-04-23 19:06:49', 8);
INSERT INTO `news` (`id`, `title`, `content`, `image`, `create_at`, `viewed`) VALUES
(132, 'У МІНІНФРАСТРУКТУРИ ПРОКОМЕНТУВАЛИ ІНІЦІАТИВУ "БОРИСПОЛЯ" ВІДПРАВИТИ RYANAIR ДО ГОСТОМЕЛЯ Більше чит', 'Омелян сподівається на підписання Ryanair договорів з аеропортами вже в травні.\r\n\r\nМіністр інфраструктури Володимир Омелян вважає, що ініціатива про залучення ірландського лоукостера Ryanair до аеропорту "Антонов" під Гостомелем замість міжнародного аеропорту "Бориспіль" є неправильною.\r\n\r\nПро це Омелян сказав в інтерв''ю LIGA.net.\r\n\r\n"Я вважаю, що якщо ми це допустимо, це буде великою помилкою. У перспективі, якщо Бориспіль стане реальним, а не потенційним хабовим аеропортом, Ryanair дійсно може піти в той же Житомир, Гостомель чи ще кудись. Але на нинішньому етапі це неправильно. У нас літає всього 4% населення. Пасажиропотік Борисполя - 8-8,5 млн осіб на рік. Це дуже мало", - наголосив міністр.\r\n\r\nОмелян зауважив, що всі аеропорти, в які заходив Ryanair, згодом нарощували пасажиропотік в рази.\r\n\r\n"Те ж саме буде і в Україні", - наголосив він.\r\n\r\nЗа словами очільника міністерства, наразі Харків готовий приймати у себе Ryanair навіть з більш низькою фінансовою пропозицією, але Ryanair поки літати туди не планує. \r\n\r\nОмелян повідомив, що робота із залучення Ryanair до України тривала понад п''ять років, а активні переговори відбувалися останні вісім місяців. \r\n\r\n"В кінці квітня представники Міністерства інфраструктури та аеропортів "Львів" і "Бориспіль" в рамках Міжнародного форуму Routes Europe, який пройде в Белфасті, проведуть зустріч з представниками Ryanair і інших авіакомпаній. Сподіваюся, всі технічні деталі будуть узгоджені, і ми зможемо підписати договори в травні", - зазначив посадовець. Більше читайте тут: https://tsn.ua/ukrayina/u-mininfrastrukturi-prokomentuvali-iniciativu-borispolya-vidpraviti-ryanair-do-gostomelya-917603.html', 'data:image/tmp;base64,', '2017-04-23 19:07:25', 122);
